	for _, tt := range tests {
		tc := tt
		t.Run(tc.name, func(t *testing.T) {
			a := NewAssembler(asm.NilRegister)

			for i := 0; i < tc.instructionsInPreamble; i++ {
				a.CompileConstToRegister(MOVD, 1000, RegR10)
			}
			backwardTarget := a.CompileStandAlone(NOP)
			for i := 0; i < tc.instructionsBeforeBranch; i++ {
				a.CompileConstToRegister(MOVD, 1000, RegR10)
			}
			br := a.CompileJump(tc.inst)
			for i := 0; i < tc.instructionsAfterBranch; i++ {
				a.CompileConstToRegister(MOVD, 1000, RegR10)
			}
			fowardTarget := a.CompileStandAlone(NOP)

			if tc.forward {
				br.AssignJumpTarget(fowardTarget)
			} else {
				br.AssignJumpTarget(backwardTarget)
			}

			actual, err := a.Assemble()
			require.NoError(t, err)

			require.Equal(t, tc.expHex, hex.EncodeToString(actual))
		})
	}
